import React, { useState } from "react";

const Search=()=>{
    const [img,setimg]=useState();
    const inputEvent=(event)=>{

        const data= event.target.value;
        setimg(data);

    }
    

    return(
        <>
        <input type="text" placeholder="here Searching" onChange={inputEvent} value={img}/>
        <img src="https://source.unsplash.com/user/erondu/200x300" alt="vijay"/>
        </>
    )

}
export default Search;
